        return String(num)
          .split('')
          .reduce((acc, curr) => {
            return acc * Number(curr);
          }, );
      }
      
      console.log(getSumOfDigits(5));   



    const myFunction =()=> {
        var element = document.getElementById("1");
        var secelement = document.getElementById("2");
        element.classList.toggle("mynewclass");
        secelement.classList.toggle("hidden");
        // console.log(element);
