        // console.log(element.classList);
     }

    return (
        <div>
            <button id='2' onClick={myFunction} className=''>Click</button>
            <div id='1' className='hidden'>
                <h1>After click</h1>
                <button onClick={myFunction}>Click</button>
            </div>
        </div>
    )
}
export default Togler
